Farewell, thou child of my right hand, and joy;
The tender bonds of love too soon unspun.
A hush has fallen where there once was ploy
Of laughter, innocence, and morning sun.
Yet in the quiet, echoes softly call—
Your tiny handprint pressed upon my heart.
No shadowed grief these memories can pall;
We’re bound by love, though forced to be apart.
Rest gently, darling, in eternal sleep;
I’ll hold you close in dreams and when I weep.
